      expenseContent = props.list.map(
        (
          expense //now this data is stored dynamically
        ) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        )
      );
    }
};

export default E
